package com.tivic.manager.grl.equipamento.radar;

public class InfoRadar {

	private int cdEquipamento;
	private String idEquipamento;
	private String nmEquipamento;
	private String dsLocal;
	private String idOrgao;
	private String nmCidade;
	private String dtUltimoEvento;
	private int qtHoras;
	
	public InfoRadar() {
		// TODO Auto-generated constructor stub
	}

	public int getCdEquipamento() {
		return cdEquipamento;
	}

	public void setCdEquipamento(int cdEquipamento) {
		this.cdEquipamento = cdEquipamento;
	}

	public String getIdEquipamento() {
		return idEquipamento;
	}

	public void setIdEquipamento(String idEquipamento) {
		this.idEquipamento = idEquipamento;
	}

	public String getNmEquipamento() {
		return nmEquipamento;
	}

	public void setNmEquipamento(String nmEquipamento) {
		this.nmEquipamento = nmEquipamento;
	}

	public String getDsLocal() {
		return dsLocal;
	}

	public void setDsLocal(String dsLocal) {
		this.dsLocal = dsLocal;
	}

	public String getIdOrgao() {
		return idOrgao;
	}

	public void setIdOrgao(String idOrgao) {
		this.idOrgao = idOrgao;
	}

	public String getNmCidade() {
		return nmCidade;
	}

	public void setNmCidade(String nmCidade) {
		this.nmCidade = nmCidade;
	}

	public String getDtUltimoEvento() {
		return dtUltimoEvento;
	}

	public void setDtUltimoEvento(String dtUltimoEvento) {
		this.dtUltimoEvento = dtUltimoEvento;
	}

	public int getQtHoras() {
		return qtHoras;
	}

	public void setQtHoras(int qtHoras) {
		this.qtHoras = qtHoras;
	}
	
	
}
